    const count = useSelector((counter)=>initialState.count.value)
    const dispatch = useDispatch()

    return(
        <>
        <button type="button" onClick={()=>dispatch(increment())}>increment +1</button>
           {/* <h2>Welcome,{count}</h2> */}
        </>
    )
}

